description.text:
Please Edit things and make it even better! Basic robotic arm compatible with the Arduino Uno! Uses 9g micro servos. Pictures of finished product with shield schematics coming soon.   
Code:  
(hashtag)include <br />
int led2 = 3;<br />
int led3 = 5;<br />
int led1 = 6;<br />
Servo LazySuzan;<br />
Servo twoLink;<br />
Servo firstLink;<br />
int start = 100;  
void setup()<br />
{<br />
//Declare Servo Ports<br />
twoLink.attach(10);<br />
firstLink.attach(9);<br />
LazySuzan.attach(8);<br />
Serial.begin(9600);<br />
delay(1000);<br />
for(int start = 100; start &gt; 0 ; start--) {<br />
analogWrite(led1, start);<br />
delay(10);<br />
analogWrite(led2, start);<br />
analogWrite(led3, start);<br />
}  
}   
void loop() {<br />
//Declare Controller Ports<br />
int turnVal = analogRead(A0) + 1000;<br />
int firstVal = analogRead(A2) + 1000;<br />
int secondVal = analogRead(A1) + 1000;  
// Print Controller Values<br />
Serial.println(turnVal);<br />
Serial.println(firstVal);<br />
Serial.println(secondVal);  
//Direct Servo Control (Testing)<br />
//LazySuzan.writeMicroseconds(1600);<br />
// delay(2000);<br />
// firstLink.writeMicroseconds(1600);<br />
// delay(2000);<br />
// twoLink.writeMicroseconds(1600);<br />
// delay(2000);  
//Led control as well as servo control<br />
twoLink.writeMicroseconds(secondVal);<br />
firstLink.writeMicroseconds(firstVal);<br />
LazySuzan.writeMicroseconds(turnVal);<br />
analogWrite(led1, turnVal / 8 - 120);<br />
analogWrite(led2, firstVal / 8 - 120);<br />
analogWrite(led3, secondVal / 8 - 120);  
}
